Defendant Johnathan Earl Coleman-Wilks in court with attorney Ann T. Bowe.  Randy P. Sitzberger appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by State, defense, and defendant. 
 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 3 YEARS, CONSECUTIVE to any other time being served with credit for 118 days. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 18 MONTHS.

The defendant IS NOT eligible for the Challenge Incarceration Program or the Substance Abuse Program.  

The Court STAYED this sentence and placed the defendant on probation for a period of 30 MONTHS with the following conditions.

CONDITIONS OF PROBATION/EXTENDED SUPERVISION:
*Obtain AODA assessment and if necessary complete follow-up care/treatment;
*Absolute sobriety with random urine screens and breathalyzer tests;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No contact with victims DeAngelo T. G. and Jeremy M.;
*Obtain/maintain full time employment or full time school with part time employment;
*Obtain high school diploma or in the alternative obtain a GED or HSED;
*Participate in Cognitive Thinking program;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs by the end of probation period- any remaining balance to convert to civil judgment;

State in compliance with victim rights legislation.  The Court ordered restitution set at zero.  If revoked, the Court ordered all financial obligations to be paid through collection of sums by the Department of Corrections from 25% of prison funds and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  The Court grants expungement upon successful completion of all conditions of probation.  Defendant is informed he may not possess and/or own any firearms.  Defendant is informed he may not vote in any election until his civil rights have been reinstated.  Appeal rights given. 
Filed;
